function Todo({ todo, toggleStatus, deleteTodo }) {
  return (
    <>
      <tr key={todo.id}>
        <th scope="row">1</th>
        <td>{todo.id}</td>
        <td>{todo.title}</td>
        <td>@mdo</td>
      </tr>
    </>
  );
}
export default Todo;
